(function() {
    let template = document.createElement("template");
    template.innerHTML = `<div id="hkmcontainer"></div><style>#cell_0_0>table>tr>td,#cell_0_2>table>tr>td{width:20px;height:20px;border:1px solid #d3d3d3;text-align:center}#cell_0_2>table>tr>td,#cell_2_2>table>tr>td{width:20px;height:20px;border:1px solid #d3d3d3;text-align:center}#cell_0_1>table>tr>td{height:20px;border:1px solid #d3d3d3}#cell_0_1>table>tr>td:nth-child(1){width:20px}#cell_0_1>table>tr>td:nth-child(2){width:250px}#cell_2_1>table>tr>td{height:20px;border:1px solid #d3d3d3}#cell_2_1>table>tr>td:nth-child(1){width:20px}#cell_2_1>table>tr>td:nth-child(2){width:250px}#cell_1_0>table>tr>td{width:20px;border:1px solid #d3d3d3}#cell_1_0>table>tr:nth-child(1)>td{height:250px}#cell_1_0>table>tr:nth-child(2)>td{height:20px}#cell_1_0>table>tr:nth-child(1)>td>div{width:20px;height:250px}#cell_1_0>table>tr:nth-child(2)>td>div{width:20px;height:20px}#cell_1_2>table>tr>td{width:20px;border:1px solid #d3d3d3}#cell_1_2>table>tr:nth-child(1)>td{height:250px}#cell_1_2>table>tr:nth-child(2)>td{height:20px}#cell_1_2>table>tr:nth-child(1)>td>div{width:20px;height:250px}#cell_1_2>table>tr:nth-child(2)>td>div{width:20px;height:20px}span{font-family:Helvetica,sans-serif;font-size:12px}td{padding:4px}table{border-collapse:collapse}.rotateLabel{transform:rotate(-90deg) translateX(-240px) translateY(-8px);transform-origin:top;white-space:nowrap}.rotateID{transform:rotate(-90deg) translateX(-8px) translateY(-8px);transform-origin:top;white-space:nowrap}.legend{width:290px;height:290px;background-image:url(data:image/png;base64,);background-size:cover}.indicator{padding:0;max-width:28px!important;max-height:28px!important;width:28px!important;height:28px!important;white-space:nowrap;overflow:hidden}.indicator>span{color:transparent;font-size:22px}#cell_0_1>table>tr{max-height:28px!important;height:28px!important}#cell_2_1>table>tr{max-height:28px!important;height:28px!important}.linkLabel{cursor:pointer}.label>tr>td:nth-child(1){background-color:rgba(200,200,200,0.2)}</style>`;
    class HKM extends HTMLElement {
        constructor() {
            super();
            let shadowRoot = this.attachShadow({
                mode: "open"
            });
            shadowRoot.appendChild(template.content.cloneNode(true));
            this._props = this.hkmDefaultSettings();
            this._init = true;
            this._firstUpdate = true;
            this._firstResize = true;
            this._selectionEvent = false;
        }
        onCustomWidgetBeforeUpdate(changedProperties) {}
        onCustomWidgetAfterUpdate(changedProperties) {
            var shadow = this.shadowRoot;
            
            let LoadLibsAfterUpdate = async function(host, data, props) {
                try {
                    await host.loadScript("https://d3js.org/d3.v4.min.js", shadow);
                } catch (e) {
                    console.log(JSON.stringify(e));
                } finally {
                    host.drawChart(data, props);
                }
            };
            if (!(this._init || this._selectionEvent)) {
                if (this._firstUpdate) {
                    LoadLibsAfterUpdate(this, this.$data, this._props);
                    this._firstUpdate = false;
                } else {
                    this.drawChart(this.$data, this._props);
                }
            }
        }
        onCustomWidgetResize(width, height) {
            var shadow = this.shadowRoot;
            this.$width = width + 'px';
            this.$height = height + 'px';
            let LoadLibsAfterResize = async function(host, data, props) {
                try {
                    await host.loadScript("https://d3js.org/d3.v4.min.js", shadow);
                } catch (e) {
                    console.log(JSON.stringify(e));
                } finally {
                    host.drawChart(data, props);
                }
            };
            if (this._firstResize) {
                LoadLibsAfterResize(this, this.$data, this._props);
                this._firstResize = false;
            } else {
                this.drawChart(this.$data, this._props);
            }
        }
        connectedCallback() {
            var shadow = this.shadowRoot;
            var custelem = shadow.host;
            this.$width = custelem.parentNode.parentNode.parentNode.style.width;
            this.$height = custelem.parentNode.parentNode.parentNode.style.height;
            let LoadLibs = async function(host, data, props) {
                try {
                    await host.loadScript("https://d3js.org/d3.v4.min.js", shadow);
                } catch (e) {
                    console.log(JSON.stringify(e));
                } finally {
                    host.drawChart(data, props);
                }
            };
            LoadLibs(this, this.$data, this._props);
            this._init = false;
        }
        disconnectedCallback() {}
		
		loadScript(src, shadowRoot) {
            return new Promise(function(resolve, reject) {
                let script = document.createElement('script');
                script.src = src;
                script.onload = () => {
                    console.log("Load: " + src);
                    resolve(script);
                };
                script.onerror = () => reject(new Error(`Script load error for ${src}`));
                shadowRoot.appendChild(script);
            });
        }
		hkmDefaultSettings(){
			return {
				leftMargin: 10, // Left margin for the chart.
				topMargin: 10, // Top margin for the chart.
				rightMargin: 10, // Right margin for the chart.
				bottomMargin: 10, // Bottom margin for the chart.
				textLength: 40 // Max length of label
			};
		}
		
        
		
        drawChart(value, config) {			
			var _data = {"dataset":{
				"master_list": {
					"aims":[
						{"id": 1, "desc": "Revenue from New products= 40% of revenue in 2025"},
						{"id": 2, "desc": "Customer OTIF in 2025 >90% (2020 ending  is 70%)"},
						{"id": 3, "desc": "Total Revenue of company in 2025= 2.8 bn USD (2020 ending is 1.8 bn USD)"}
					],
					"initiatives":[
						{"id": 1, "desc": "15 filings and 22 launches for 2021"},
						{"id": 2, "desc": "Customer OTIF in 2021 is 74%"},
						{"id": 3, "desc": "Revenue for 2021 is 1.97 bn USD"}
					],
					"deliverables":[
						{"id": 1, "desc": "Expand sales in focus areas- Onco, Cardiology", "link":""},
						{"id": 2, "desc": "1-2 Product extensions for matured products", "link":""},
						{"id": 3, "desc": "Capacity availability for supply assurance", "link":""},
						{"id": 4, "desc": "Resolution of product quality issues", "link":""},
						{"id": 5, "desc": "Improve product selection to launch success rate"},
						{"id": 6, "desc": "Expedite product transfer from lab to Mfg set up"}
					],
					"results":[
						{"id": 1, "desc": "Growth in Onco and Cardiology products at 20% (higher than industry avg)"},
						{"id": 2, "desc": "2 line extensions for 5 out of top 10 products"},
						{"id": 3, "desc": "Portfolio expansion: 80% revenue from 6 products (current at 5 products)"},
						{"id": 4, "desc": "CapEx for volume growth- Readiness for commercial: Plan vs actual"},
						{"id": 5, "desc": "Lot Acceptance Rate"},
						{"id": 6, "desc": "Product yield"},
						{"id": 7, "desc": "Control write offs to <0.1% of sales"},
						{"id": 8, "desc": "Launch to selection rate ratio at 0.5"},
						{"id": 9, "desc": "Revenue per new launch"},
						{"id": 10, "desc": "New product batches plan vs actual"}
					]
				},
				"ai_matrix":[
					[1,1,0],
					[2,2,1],
					[3,3,0]
				],
				"id_matrix":[
					[1,5,0],
					[1,6,0],
					[2,3,2],
					[2,4,0],
					[3,1,0],
					[3,2,4]
				],
				"dr_matrix":[
					[1,1,0],
					[2,2,4],
					[3,2,4],
					[4,3,2],
					[5,4,0],
					[6,4,0],
					[7,4,0],
					[8,5,0],
					[9,5,0],
					[10,6,0]
				]
			}};			

            var r = this.shadowRoot;
            var _div = r.querySelector('div');
            _div.style.width = this.$width - 10;
            _div.style.height = this.$height;
            _div.innerHTML = '';
			
			var chart = this.hoshinKanri(value, config, this.shadowRoot, this, _data);            
        }
		
		hoshinKanri(value, config, root, eventDispatcher, data){
			
			if(config == null) config = hkmDefaultSettings();
			
			//var vis = d3.select("#" + elementId);
			var vis = d3.select(root.querySelector('#hkmcontainer'));
	
			var aList = data.dataset.master_list.aims,
				aCount = aList.length,	
				iList = data.dataset.master_list.initiatives,
				iCount = iList.length,
				dList = data.dataset.master_list.deliverables,
				dCount = dList.length,
				rList = data.dataset.master_list.results,
				rCount = rList.length;
			
			// Draw initial structure
			var rootTable = vis.append("table");
			
			for(var i=0; i<3; i++){
				rootTable.append("tr").attr("id","row"+i);
				for(var j=0; j<3; j++){
					var r = d3.select(root.querySelector("#row"+i));
					r.append("td").attr("id","cell_"+i+"_"+j);
				}
			}
			
			// Draw A-I Matrix [cell_0_0]
			var aiMatrix = d3.select(root.querySelector("#cell_0_0")).append("table");
			aiMatrix.attr("cellspacing","0");
			for(var i=0; i<iCount; i++){
				aiMatrix.append("tr").attr("id","ai"+i);
				for(var j=0; j<aCount; j++){
					var r = d3.select(root.querySelector("#ai"+i));
					r.append("td").attr("id","ai_"+i+"_"+j).attr('class','indicator').append("span").text("●");
				}
			}
			
			// Draw I Labels [cell_0_1]
			var iLabel = d3.select(root.querySelector("#cell_0_1")).append("table").attr('class', 'label');
			iLabel.attr("cellspacing","0");
			for(var i=0; i<iCount; i++){
				var r = iLabel.append("tr");
				r.append("td").append("span").text(iList[i].id);
				r.append("td").append("span").attr("title", iList[i].desc).text(trimText(iList[i].desc, config));
			}
			
			// Draw I-D Matrix [cell_0_2]
			var idMatrix = d3.select(root.querySelector("#cell_0_2")).append("table");
			idMatrix.attr("cellspacing","0");
			for(var i=0; i<iCount; i++){
				idMatrix.append("tr").attr("id","id"+i);
				for(var j=0; j<dCount; j++){
					var r = d3.select(root.querySelector("#id"+i));
					r.append("td").attr("id","id_"+i+"_"+j).attr('class','indicator').append("span").text("●");
				}
			}
			
			// Draw A Labels [cell_1_0]
			var aLabel = d3.select(root.querySelector("#cell_1_0")).append("table").attr('class', 'label');
			aLabel.attr("cellspacing","0");
			var r1 = aLabel.append("tr");
			var r2 = aLabel.append("tr");
			for(var j=0; j<aCount; j++){			
				r1.append("td").append("div").attr('class','rotateLabel').append("span").attr("title", aList[j].desc).text(trimText(aList[j].desc, config));
				r2.append("td").append("div").attr('class','rotateID').append("span").text(aList[j].id);
			}
			
			// Draw Legend Image [cell_1_1]
			var legend = d3.select(root.querySelector("#cell_1_1")).append("div").attr('class','legend');
			
			// Draw D Labels [cell_1_2]
			var dLabel = d3.select(root.querySelector("#cell_1_2")).append("table").attr('class', 'label');
			dLabel.attr("cellspacing","0");
			var r3 = dLabel.append("tr").attr("id","dLabels");
			var r4 = dLabel.append("tr");
			for(var j=0; j<dCount; j++){
				if(dList[j].link === undefined || dList[j].link == ''){
					r3.append("td").append("div").attr('class','rotateLabel')
					.append("span").attr('id','dlabel_'+j).attr("title", dList[j].desc).text(trimText(dList[j].desc, config));
				} else{
					r3.append("td").append("div").attr('class','rotateLabel')
					.append("span").attr('class','linkLabel')
					.attr('id','dlabel_'+j).append("a").attr("href", dList[j].link).attr("target", '_blank')
					.attr("title", dList[j].desc).text(trimText(dList[j].desc, config));
				}				
				r4.append("td").append("div").attr('class','rotateID').append("span").text(dList[j].id);		
			}
			
			
			// Draw R Labels [cell_2_1]
			var rLabel = d3.select(root.querySelector("#cell_2_1")).append("table").attr('class', 'label');
			rLabel.attr("cellspacing","0");
			for(var i=0; i<rCount; i++){
				var r = rLabel.append("tr");
				r.append("td").append("span").text(rList[i].id);
				r.append("td").append("span").attr("title", rList[i].desc).text(trimText(rList[i].desc, config));
			}
			
			// Draw D-R Matrix [cell_2_2]
			var drMatrix = d3.select(root.querySelector("#cell_2_2")).append("table");
			drMatrix.attr("cellspacing","0");
			for(var i=0; i<rCount; i++){
				drMatrix.append("tr").attr("id","dr"+i);
				for(var j=0; j<dCount; j++){
					var r = d3.select(root.querySelector("#dr"+i));
					r.append("td").attr("id","dr_"+i+"_"+j).attr('class','indicator').append("span").text("●");
				}
			}
			
			//Draw AI Matrix dots
			var aiData = data.dataset.ai_matrix;
			for(var i=0; i<aiData.length; i++){
				var record = aiData[i];
				var cellID = "#ai_"+(record[1]-1)+"_"+(record[0]-1);
				var color = "", title = '';
				if(record[2] == 0){
					color = "green";
					title = "On track";
				} else if(record[2] == 1){
					color = "orange";
					title = "Off track put plan to correct";
				} else if(record[2] == 2){
					color = "red";
					title = "Off track with no correction plan in place";
				} else{
					color = "grey";
					title = "Not Started";
				}
				
				d3.select(root.querySelector(cellID)).select("span").style("color", color).attr("title", title);
			}
			
			//Draw ID Matrix dots
			var idData = data.dataset.id_matrix;
			for(var i=0; i<idData.length; i++){
				var record = idData[i];
				var cellID = "#id_"+(record[0]-1)+"_"+(record[1]-1);
				var color = "", title = '';
				if(record[2] == 0){
					color = "green";
					title = "On track";
				} else if(record[2] == 1){
					color = "orange";
					title = "Off track put plan to correct";
				} else if(record[2] == 2){
					color = "red";
					title = "Off track with no correction plan in place";
				} else{
					color = "grey";
					title = "Not Started";
				}
				
				d3.select(root.querySelector(cellID)).select("span").style("color", color).attr("title", title);
			}
			
			//Draw DR Matrix dots
			var drData = data.dataset.dr_matrix;
			for(var i=0; i<drData.length; i++){
				var record = drData[i];
				var cellID = "#dr_"+(record[0]-1)+"_"+(record[1]-1);
				var color = "", title = '';
				if(record[2] == 0){
					color = "green";
					title = "On track";
				} else if(record[2] == 1){
					color = "orange";
					title = "Off track put plan to correct";
				} else if(record[2] == 2){
					color = "red";
					title = "Off track with no correction plan in place";
				} else{
					color = "grey";
					title = "Not Started";
				}
				
				d3.select(root.querySelector(cellID)).select("span").style("color", color).attr("title", title);
			}
			
			function trimText(text, config){
				var newText = "";
				if(text.length <= config.textLength){
					newText = text;
				} else{
					newText = text.substring(0, config.textLength-3) + "...";
				}
				return newText;
			}
			
			return this;
		}
        
    }
    customElements.define("com-gmail-cse-ari007-hoshinkanri", HKM);
})();